import React, { FunctionComponent } from "react";
import { RouteComponentProps } from "react-router-dom";
import {
  GivePage,
  MailPage,
  NotePage,
  OrganizePage,
  ReadPage,
  WritePage,
} from "./ProductPages";

interface MatchParams {
  type: string;
}
interface Props extends RouteComponentProps<MatchParams> {}

const Products: React.FC<Props> = ({ match }) => {
  let productType: string = match.params.type;
  let productKindPaget: React.FC<Props> = MailPage;
  switch (productType) {
    case "mail":
      productKindPage = MailPage;
      break;
    case "notes":
      productKindPage = NotePage;
      break;
    case "organize":
      productKindPage = OrganizePage;
      break;
    case "read":
      productKindPage = ReadPage;
      break;
    case "write":
      productKindPage = WritePage;
      break;
    case "give":
      productKindPage = GivePage;
      break;
  }

  return productKindPage;
};

export default Products;
